import React from 'react'
import Layouts from '../Layouts/Layouts'
import student from './../assests/images/Icons/student.png';
import { HomeIcon } from 'lucide-react';
function Home() {  
   const homeData =[
    {src:student,title:'Add Student',toRoute:'/s/addStudeent'}
   ]
  return (
    <Layouts>
        <div className='' style={{zIndex:0}}>
          <div className='flex flex-col flex-wrap'>
            {homeData.map((data,key)=>(
              <>
                <HomeIcon src={data.src} title={data.title} toRoute={data.to} />
              </>
            ))}

          </div>
        </div>
    </Layouts>
  )
}

export default Home
